import React from 'react';

function Footer() {
  return (
    <footer className="bg-dark text-white text-center py-3">
      <div className="container">
        <p className="mb-0">&copy; 2024 Apki Car Hamara Care. All rights reserved.</p>
      </div>
    </footer>
  );
}

export default Footer;
